  01> ROBINSON, Vita Juliet
  b 20.12.1982
  Vita b. at Kawakawa.
  02> ROBINSON, Amelia Frances
  b 06.10.1984
  Amelia b. at Kawakawa.
  03> ROBINSON, Nelson Carleton
  b 12.07.1986
  Nelson b. at Kawakawa.
  ROBINSON, Nicholas John m on 26.05.1984 to BLASIUS, Betty Ann (Betts)
  b 19.11.1953
  b 28.10.1956
  Nicholas b, at Waipukurau and m. at Edmonton, Canada. Betty, d/o Theodore Blasius and Anna Margaret
  McGillis, b, at Edmonton, Canada. Address: 5910a 17a Avenue, South Delta, BC V4L 1JC, Canada.
  Nicholas was educated at Flemington School and Christ's College, Christchurch (School House, House
  Prefect). He qualified as a pilot in 1970 aged 16, having gained a flying scholarship with the
  Canterbury Aero Club. He later flew a 'paper-run' to Gisborne from Napier, and a 'shark and surf'
  report around Hawkes Bay. He later qualified as a helicopter pilot and flew on deer recovery on
  the West Coast, and on tourist work for New Zealand Helicopters in Rotorua. He later returned to
  fixed wing flying and worked for Mount Cook Airlines in Queenstown and Christchurch before
  emigrating in 1991 to Canada. He flew for Time Air Airline but was made redundant a year later.
  He then took up an apprenticeship with a cabinet maker in Vancouver. This was transferred to a
  firm in Edmonton when Nick and his family moved to Alberta, and he completed his course in 1997.
  01> ROBINSON, Benjamin Francis
  b 18.09.1986
  Benjamin b. at Rotorua.
  02> ROBINSON, Jacob Alexander
  b 03.06.1988
  Jacob b. at Queenstown.
  04> ROBINSON, Alastair Garth m on 12.03.1988 to MANNION, Penelope Cranston
  b 05.11.1956
  b 30.05.1961
  Alastair b. at Waipukurau. Penelope, d/o Neil Mannion and Julia Wigley, b,
  at Paparoa. Address: "Te Pera", RD 3, Kerikeri.
  Alastair was educated at Flemington School and Christ's College,
  Christchurch and gained a BAgCom from Lincoln College in 1979. He rowed
  for NZ Universities. He played rugby for Canterbury Colts and captained
  the North Auckland Provincial team. He was an All Black in 1983 and played
  in the World XV in the Twickenham Centenary Match v England. He was co-selector and coach for the
  North Auckland Development squad and Chairman of the North Auckland Coaching Committee. He was also
  President of the Ohaeawai Branch of the Federated Farmers.
  Penny was educated at Tauraroa School and St Cuthbert's College, Auckland, representing her school
  in senior-A netball. She trained as a registered general and obstetric nurse (1979-82) then
  travelled overseas for three years. She now works as a family planning nurse and adolescent health
  nurse.
  Alastair, Penny and their family live on their organic sheep and beef farm near Kerikeri.
